      <div>
        <h1>Orders</h1>
        <p>Manage orders, order list, purchases</p>
        <ol>
          <li>Saved book marks</li>
          <li>Favorites</li>
          <li>Subscripmtion</li>
          <li>etc</li>
        </ol>
      </div>
    );
  }
}

export default Orders;
